import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import '../styles/Header.css';

// Material UI imports
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import Tooltip from '@mui/material/Tooltip';
import MenuItem from '@mui/material/MenuItem';
import Badge from '@mui/material/Badge';
import Drawer from '@mui/material/Drawer';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import Divider from '@mui/material/Divider';
import Chip from '@mui/material/Chip';

// Icons
import MenuIcon from '@mui/icons-material/Menu';
import DashboardIcon from '@mui/icons-material/Dashboard';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';
import MedicationIcon from '@mui/icons-material/Medication';
import MonitorHeartIcon from '@mui/icons-material/MonitorHeart';
import FolderIcon from '@mui/icons-material/Folder';
import PeopleIcon from '@mui/icons-material/People';
import NotificationsIcon from '@mui/icons-material/Notifications';
import LogoutIcon from '@mui/icons-material/Logout';
import SettingsIcon from '@mui/icons-material/Settings';
import LocalHospitalIcon from '@mui/icons-material/LocalHospital';

function Header({ user = { name: 'Ari Berkowitz', role: 'admin', photoUrl: 'https://randomuser.me/api/portraits/men/64.jpg' }, onLogout }) {
  const location = useLocation();
  const [drawerOpen, setDrawerOpen] = useState(false);
  const [anchorElUser, setAnchorElUser] = useState(null);
  const [anchorElNotifications, setAnchorElNotifications] = useState(null);

  const handleOpenUserMenu = (event) => {
    setAnchorElUser(event.currentTarget);
  };

  const handleCloseUserMenu = () => {
    setAnchorElUser(null);
  };

  const handleOpenNotificationsMenu = (event) => {
    setAnchorElNotifications(event.currentTarget);
  };

  const handleCloseNotificationsMenu = () => {
    setAnchorElNotifications(null);
  };

  const toggleDrawer = (open) => (event) => {
    if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
      return;
    }
    setDrawerOpen(open);
  };

  const menuItems = [
    { text: 'Dashboard', icon: <DashboardIcon />, path: '/' },
    { text: 'Schedule', icon: <CalendarMonthIcon />, path: '/schedule' },
    { text: 'Health Tracking', icon: <MonitorHeartIcon />, path: '/health' },
    { text: 'Medications', icon: <MedicationIcon />, path: '/medications' },
    { text: 'Documents', icon: <FolderIcon />, path: '/documents' },
    { text: 'Family Members', icon: <PeopleIcon />, path: '/family' },
    { text: 'Medical Contacts', icon: <LocalHospitalIcon />, path: '/contacts' },
  ];

  const notifications = [
    { id: 1, text: 'Dialysis appointment tomorrow at 9 AM', isNew: true, time: '10 min ago' },
    { id: 2, text: 'Medication refill ready for pickup', isNew: true, time: '2 hours ago' },
    { id: 3, text: 'Dr. Goldstein added new lab results', isNew: false, time: 'Yesterday' },
    { id: 4, text: 'Weight increased by 2kg since last check', isNew: false, time: '2 days ago' },
  ];

  const drawerList = () => (
    <Box
      sx={{ width: 280 }}
      role="presentation"
      onClick={toggleDrawer(false)}
      onKeyDown={toggleDrawer(false)}
    >
      <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', p: 2, pb: 1 }}>
        <Box 
          component="img"
          sx={{ height: 50, mt: 1, mb: 2 }}
          alt="Care Logo"
          src="/logo192.png"
        />
        <Typography variant="h5" component="div" sx={{ color: 'primary.main', fontWeight: 'bold' }}>
          Care
        </Typography>
        <Typography variant="subtitle2" sx={{ mb: 1 }}>
          Family Eldercare Coordinator
        </Typography>
      </Box>

      <Divider />

      <Box sx={{ p: 2, pt: 1, pb: 1 }}>
        <Typography variant="subtitle2" color="text.secondary">
          PATIENT
        </Typography>
      </Box>

      <Box sx={{ display: 'flex', alignItems: 'center', px: 2, pb: 2 }}>
        <Avatar
          alt="Rabbi Berkowitz"
          src="https://randomuser.me/api/portraits/men/78.jpg"
          sx={{ width: 56, height: 56, mr: 2 }}
        />
        <Box>
          <Typography variant="body1" fontWeight="medium">Rabbi Berkowitz</Typography>
          <Chip 
            label="Dialysis Patient" 
            size="small" 
            color="primary" 
            variant="outlined" 
            sx={{ mt: 0.5 }}
          />
        </Box>
      </Box>

      <Divider />

      <Box sx={{ p: 2, pt: 1, pb: 1 }}>
        <Typography variant="subtitle2" color="text.secondary">
          MENU
        </Typography>
      </Box>

      <List>
        {menuItems.map((item) => (
          <ListItem 
            button 
            key={item.text} 
            component={Link} 
            to={item.path}
            selected={location.pathname === item.path}
            sx={{
              pl: 2.5,
              borderLeft: location.pathname === item.path ? '4px solid' : '4px solid transparent',
              borderColor: 'primary.main',
              '&.Mui-selected': {
                backgroundColor: 'rgba(0, 116, 217, 0.08)'
              }
            }}
          >
            <ListItemIcon sx={{ color: location.pathname === item.path ? 'primary.main' : 'inherit' }}>
              {item.icon}
            </ListItemIcon>
            <ListItemText primary={item.text} />
          </ListItem>
        ))}
      </List>

      <Divider sx={{ mt: 2 }} />

      <List>
        <ListItem button sx={{ pl: 2.5 }}>
          <ListItemIcon>
            <SettingsIcon />
          </ListItemIcon>
          <ListItemText primary="Settings" />
        </ListItem>
        <ListItem button onClick={onLogout} sx={{ pl: 2.5 }}>
          <ListItemIcon>
            <LogoutIcon />
          </ListItemIcon>
          <ListItemText primary="Logout" />
        </ListItem>
      </List>
    </Box>
  );

  return (
    <>
      <AppBar position="fixed" color="default" elevation={1} sx={{ zIndex: (theme) => theme.zIndex.drawer + 1, bgcolor: 'white' }}>
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
            onClick={toggleDrawer(true)}
          >
            <MenuIcon />
          </IconButton>

          <Typography
            variant="h6"
            noWrap
            component={Link}
            to="/"
            sx={{
              mr: 2,
              display: { xs: 'none', md: 'flex' },
              fontWeight: 700,
              color: 'primary.main',
              textDecoration: 'none',
            }}
          >
            Care
          </Typography>

          <Box sx={{ flexGrow: 1 }} />

          <Box sx={{ display: 'flex', alignItems: 'center' }}>
            <Tooltip title="Notifications">
              <IconButton 
                size="large" 
                color="inherit"
                onClick={handleOpenNotificationsMenu}
              >
                <Badge badgeContent={2} color="error">
                  <NotificationsIcon />
                </Badge>
              </IconButton>
            </Tooltip>

            <Tooltip title="Account settings">
              <IconButton onClick={handleOpenUserMenu} sx={{ p: 0, ml: 2 }}>
                <Avatar alt={user.name} src={user.photoUrl} />
              </IconButton>
            </Tooltip>
          </Box>
        </Toolbar>
      </AppBar>

      {/* User Menu */}
      <Menu
        sx={{ mt: '45px' }}
        id="menu-appbar"
        anchorEl={anchorElUser}
        anchorOrigin={{
          vertical: 'top',
          horizontal: 'right',
        }}
        keepMounted
        transformOrigin={{
          vertical: 'top',
          horizontal: 'right',
        }}
        open={Boolean(anchorElUser)}
        onClose={handleCloseUserMenu}
      >
        <Box sx={{ px: 2, py: 1 }}>
          <Typography variant="subtitle1">{user.name}</Typography>
          <Typography variant="body2" color="text.secondary">{user.role}</Typography>
        </Box>
        <Divider />
        <MenuItem component={Link} to="/profile">
          <ListItemIcon>
            <Avatar sx={{ width: 24, height: 24 }} />
          </ListItemIcon>
          <Typography textAlign="center">My Profile</Typography>
        </MenuItem>
        <MenuItem component={Link} to="/settings">
          <ListItemIcon>
            <SettingsIcon fontSize="small" />
          </ListItemIcon>
          <Typography textAlign="center">Settings</Typography>
        </MenuItem>
        <Divider />
        <MenuItem onClick={onLogout}>
          <ListItemIcon>
            <LogoutIcon fontSize="small" />
          </ListItemIcon>
          <Typography textAlign="center">Logout</Typography>
        </MenuItem>
      </Menu>

      {/* Notifications Menu */}
      <Menu
        sx={{ mt: '45px' }}
        id="notifications-menu"
        anchorEl={anchorElNotifications}
        anchorOrigin={{
          vertical: 'top',
          horizontal: 'right',
        }}
        keepMounted
        transformOrigin={{
          vertical: 'top',
          horizontal: 'right',
        }}
        open={Boolean(anchorElNotifications)}
        onClose={handleCloseNotificationsMenu}
      >
        <Box sx={{ px: 2, py: 1 }}>
          <Typography variant="subtitle1">Notifications</Typography>
        </Box>
        <Divider />
        {notifications.map((notification) => (
          <MenuItem key={notification.id} sx={{ py: 1.5, px: 2 }}>
            <Box sx={{ width: 300 }}>
              <Box sx={{ display: 'flex', alignItems: 'center', mb: 0.5 }}>
                <Typography variant="body1">{notification.text}</Typography>
                {notification.isNew && (
                  <Chip 
                    label="New" 
                    size="small" 
                    color="primary" 
                    sx={{ ml: 1, height: 20, fontSize: '0.6rem' }}
                  />
                )}
              </Box>
              <Typography variant="caption" color="text.secondary">{notification.time}</Typography>
            </Box>
          </MenuItem>
        ))}
        <Divider />
        <MenuItem sx={{ justifyContent: 'center' }}>
          <Typography variant="body2" color="primary">View All Notifications</Typography>
        </MenuItem>
      </Menu>

      {/* Navigation Drawer */}
      <Drawer
        anchor="left"
        open={drawerOpen}
        onClose={toggleDrawer(false)}
      >
        {drawerList()}
      </Drawer>

      {/* Spacer for fixed header */}
      <Toolbar />
    </>
  );
}

export default Header;
